import { Fragment } from "react";
import React from "react";
import Navbar from "./Navbar";
import styled from "styled-components";
import { mobile } from "../responsive";

const Wrapper = styled.div`
  padding: 100px;
  ${mobile({ padding: "10px" })}
`;
function Cart() {
  return (
    <Fragment>
      <header>
        <Navbar></Navbar>
      </header>
      <Wrapper>
        <section>
          <div>
            <h1 class="heading">
              {" "}
              <span> My </span> Cart{" "}
            </h1>
          </div>
        </section>
      </Wrapper>
    </Fragment>
  );
}

export default Cart;
